import React from 'react';
import { GoogleMap, Marker, DirectionsRenderer } from "react-google-maps"
import './style.css';

const mapStyles = {
  width: '100%',
  height: '100%'
};

export class MapContainer extends React.Component {
  constructor(props) {
    super(props);
  }




  render() {
    return (
      <div>
          <GoogleMap
              defaultZoom={8}
              defaultCenter={{ lat: -34.397, lng: 150.644 }}
            ></GoogleMap>

      </div>
      );
  }
}
